import "./Rt.css";
import axios from "axios"
import { useState, useEffect } from 'react'

const Rt = () => {

  // 데이터 가져오는 함수 
    const [myRtData, myRtSetData] = useState([]) // 데이터를 저장할 상태
    const [otherRtData, otherRtSetData] = useState([]) // 데이터를 저장할 상태
    const [storeList, storeListSetData ] = useState([])
    const csrfToken = "87D711B086463B79422F3BE8478346FA"; // CSRF 토큰

    // 지시요청 조회 데이터 요청 함수
    const getMyRtData = async () => {
      try {
        const endpoints = [
          { key: 'myRtData', url: 'http://localhost:8080/api/rt/meToOtherRtlist' },
          { key: 'otherRtData', url: 'http://localhost:8080/api/rt/OtherToMeRtlist' },
          { key: 'storeList', url: 'http://localhost:8080/api/rt/store' },
        ];

        const requests = endpoints.map(({ url }) =>
          axios.get(url, {
            withCredentials: true,
            headers: { 'X-CSRF-TOKEN': csrfToken },
          })
        );

        const responses = await axios.all(requests);

        const updatedData = responses.reduce((acc, response, index) => {
          acc[endpoints[index].key] = response.data;
          return acc;
        }, {});

        setData(updatedData);
      } catch (error) {
        if (error.response?.status === 302) {
          console.error('리다이렉션 발생:', error.response.headers.location);
        } else {
          console.error('Error:', error);
        }
      }
    };
    useEffect(() => {
      getMyRtData()
      getOtherRtData()
      getStoreListData()
    }, []);

    console.log(storeList)

  return(

    <div className="rtPage">
      <h1>매장 RT 관리 </h1>
      <hr />
      <div className="mainContent">

        <div className="searchBar">
          <div className="date">
            <label className="name">지시기간</label>
            <input id="input_date" type="date" />
          </div>

          <div className="checkbox">
            <label className="name">처리구분</label>
            <span className="fristCheckbox">
              <label>미확정</label>
              <input type="radio" />
            </span>
            <span>
              <label>확정</label>
              <input type="radio" />
            </span>
            <span>
              <label>불이행</label>
              <input type="radio" />
            </span>
          </div>

          <div className="selector">
            <label className="name">매장</label> 
            <select>
              <option>매장 선택</option>
              <option>부산 서면점</option>
              <option>수원점</option>
              <option>강남점</option>
              <option>대전점</option>


            </select>
          </div>

          <div className="buttons">
            <button id="searchButton">조회</button>
            <button id="createButton">등록</button>
          </div>
        </div>

        <div className="searchTable">
          <div className="tableName">
            <h3>지시요청 조회</h3>  
          </div>
          <table>
            <thead>
              <tr>
                <th>품번</th>
                <th>품명</th>
                <th>색상</th>
                <th>사이즈</th>
                <th>지시매장</th>
                <th>지시수량</th>
                <th>RT 지시일</th>
                <th>상태</th>
              </tr>
            </thead>
             {myRtData.length > 0 ? (
                  <tbody>
                    {myRtData.map((item, index) => {
                      return (
                        <tr key={item.rt_id}>
                          <td>{item.product_code}</td>
                          <td>{item.product_name}</td>
                          <td>{item.color_code}</td>
                          <td>{item.product_size}</td>
                          <td>{item.request_store}</td>
                          <td>{item.rt_products[0].request_quantity}</td>
                          <td>{item.request_date}</td>
                          <td>{item.rt_status}</td>
                        </tr>
                      )
                    })}
                  </tbody>
            ): ( 
              <tbody>
              데이터가 없습니다
              </tbody>
              )
            }

          </table>
        </div>
